import React from 'react';
import PropTypes from 'prop-types';

const Navbar = ({}) => {
  return (
    <div>
      <nav>
        <a href='/' className='brand-logo center'>
          <b
            className='#004d40 teal-text text-darken-4 '
            style={{ fontSize: '70px' }}
          >
            IDE
          </b>
        </a>
      </nav>
    </div>
  );
};

export default Navbar;
